    value: 'Amended report clarifies description for expenditure to The Stoneridge
      Group LLC on Sch B, line 30b on 9/16/10. Report reflects contributions in excess
      of the limit for Thomas F. Petway on Sch A. Refer to Sch B, line 28a for a contribution
      refund on 9/20/10 to him. The contributors with London address are US citizens.
      Expenditures to Faulkner Strategies and The Stoneridge Group, LLC on Sch B,
      line 30b, represent exempt activity expenditures as defined in 11 CFR 100.87
      and 100.147 and were distributed by volunteers. These expenses were not paid
      for with transfers in from the Republican National Committee or from funds designated
      for a particular candidate. No expenditure, other than a direct contribution
      or exempt activity so identified, was made on behalf of a specifically identified
      federal candidate. No expenditure not identified as such was for a public communication
      that referred to a clearly identified candidate for Federal office and that
      promoted, supported, attacked or opposed any such candidate for Federal office.
      All expenditures to individuals for rent represent rent income to those individuals
      and are not required to be itemized. All disbursements for salaries and benefits
      disclosed on Schedule H4 are for employees who did not spend more than 25% of
      their compensated time during the reporting period on Fed election activities
      or activities in connection with a Federal election. All transfers for allocated
      activity reported on Sch H3 occurred within the 70-day permitted window of time.
      The Committee uses the Escrow option for receipt of corporate in-kind donations
      as provided for by the Commission in Advisory Opinion 1992-33. The method ensures
      that prohibited sources are not used to fund the federal share of allocable
      activity expenses. In-kind details and the escrow account activity are summarized
      as follows:   Admin Acct: 9/1/10 Admin escrow balance $75.75   9/1/10 transfer
      to Admin escrow account of $840.  9/4/10 Yuma Solutions in-kind of $4,000 as
      reflected on Sch H4 and transfer on Sch H3 using $840 of escrow balance.  9/29/10
      transfer to Admin escrow account from MD-10B escrow account of $1,000.  9/29/10
      Pinchers Crab Shack in-kind of $1,000 as reflected on Sch H4 and transfer on
      Sch H3 using $210 of escrow balance.  9/30/10 transfer to Admin escrow account
      of $2,500.  9/30/10 Admin escrow balance of $3,365.75  9/1/10 MD-10B escrow
      account balance is $426.64.  9/9/10 transfer to MD-10B escrow account of $30,000.  9/10/10
      Disney Worldwide Services in-kind of $173,727 as reflected on Sch H4 and transfer
      on Sch H3 using $26,059.05 of escrow balance.  9/10/10 The Villages Equipment
      Company in-kind of $2,628 as reflected on Sch H4 and transfer on Sch H3 using
      $394.20 of escrow balance.  9/10/10 Mears Transportation Group in-kind of $2,440
